import logo from './logo.svg';
import './App.css';
import React, {useState, useRef} from 'react';
import {ProfileChag} from './modals/ProfileChag';
  const Teamname = '산기대';
  const Email = '이메일';
  const firstName = 'Lee';
  const lastName = 'jiyoon';
function App() {
const [Image, setImage] = useState("https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_1280.png")
const fileInput = useRef(null)
const [ImgModalon, setImgModalon] = useState(false);
  return (
    <div className="App">
      <ProfileChag show = {ImgModalon} onHide={() => setImgModalon(false)}/>

     <div className='header'>
       <h4>My Profile</h4> 
     </div> <hr/> 

     <div>
     <img className = 'profile_img'
       src={Image} 
       onClick={()=>setImgModalon(true)}
      />
      </div>

      <div className='user_info'>
      <h4>Team name</h4>
      <h5>{Teamname}</h5>
      <h4>Email</h4>
      <h5>{Email}</h5>
      </div>

    <div className='wrapper'>
      <h4>First Name</h4>
      <input type='text' className = 'firstName' value={firstName}></input>
      <span className='underline1'></span>
      <h4>Last Name</h4>
      <input type='text' className = 'lastName' value={lastName}></input>
      <span className='underline2'></span>
    </div>
    <div className='save'>
      <button className='save_button'> Save</button>
    </div>

    <div className='Password'>
      <h4>Password</h4>
      <p>You can set a new Password</p>
      <button className='pass_btn'>Change Password</button>
    </div>
      </div>
  );
}

export default App;
